import React from 'react';
import './filter.css';

const buttons = [
  {name: 'all', label: 'All'}
];

const Filter = () => {
  return (
    <div>
      <button type='button'>All</button>
      <button type='button'>Active</button>
      <button type='button'>Done</button>
    </div>
  );
}

export default Filter;
